class ALG{
  static learnt = new Set([0]); //{"bit":key,"type":1/0/und(pass)}
  static dict = {"":{"bit":0,
                     // "eq":0,"sum":0
                    }};


  //[all zeros, 0..., | 1..., all ones]




  static classify(dict,ans=0){
      let str = ""
      let cont = true
      let bitsUsed = new Set()
      let keysUsed = new Set()
      let bit;
     while(cont){
       


       if(this.dict[str].type === undefined){ //its a node
         
         
        bit = this.dict[str].bit
         
         
         
         bitsUsed.add(bit+"")
         
         let skip = (this.dict[str].skip===undefined?"":this.dict[str].skip)
         
         let ansbit = dict[bit]

         if(ansbit===undefined){
          let randAns = Math.random()>0.5?1:0
          // console.log("skipping bit "+bit+" at " + str + " as "+randAns) // here this should be bit defaulting
          ansbit = randAns //it seems like the only bit that is skipped is the one that got upleveled?
         }


         str += skip+ansbit



         keysUsed.add(str)
         
         // console.log("going down "+str)
       } else { //not a node
         
         if(ans === this.dict[str].type || ans === 2){ //answer is correct
           
           keysUsed.forEach((e)=>{
             let d = this.dict[e]
                // d.sum += 1
                // d.eq += this.dict[str].type
                // d.pers = (d.eq + 1) / (d.sum + 2)
                            })
           
           if(this.debug){
             console.log("ending: "+bit+" - "+str)
           }
           
           return({a:this.dict[str].type,s:str,b:bitsUsed})
         } else{ //does not exist
           let len = Object.keys(dict).length
           
           if(ans === 2){
            return({a:2,s:"none",b:"none"})
           }
           let gb = getBiggest2()
           // gb = ["+13","+11","+12"]
           let i = 0
           let newBit = gb[0].substr(1)
           
           while(bitsUsed.has(newBit+"")){
             // newBit = Math.floor(Math.random()*(len-15))
             if(Math.random()>0.9999){
               // console.log("stuck")
               return("stuck"+str)
             }
             i += 1
             newBit = parseInt(gb[i].substr(1))

             //new bit here should be random
             
           }
           console.log("learning: "+newBit+"-"+str)
           this.dict[str].type = undefined
           bitsUsed.add(newBit)
           this.learnt.add(newBit)
           this.dict[str].bit = newBit
           
         }
       }
       
       if(this.dict[str] === undefined){
         this.dict[str] = {"type":ans,
                           // "eq":0,"sum":0
                          }
       }
     }
    
    return({a:this.dict[str].type,s:str,b:bitsUsed})
    
  }

  static hierarchicalShift(Akey){
    //0 : {bit:1,und,bitof0}
    //00 : {bit:2,und, bitof1}
    //01 : {bit:3,und, bitof1}
    
    let A = this.dict[Akey]
    let B1 = this.dict[Akey+"1"]
    let B2 = this.dict[Akey+"0"]
    
    let NA1 = JSON.parse(JSON.stringify(A));
    let NA2 = JSON.parse(JSON.stringify(A));
    let NB = JSON.parse(JSON.stringify(B1));
    
    //we should verify that B1.bit == B2.bit

    if(B1.bit === undefined){

        if(B2.bit === undefined){
            console.log("tried to hshift a 2 terminator parent")
            return;
        }

        B1.bit = B2.bit;
        this.dict[Akey+"11"] = {type:B1.type}
        this.dict[Akey+"10"] = {type:B1.type}
        delete B1.type
    } 
    if(B2.bit === undefined){
        B2.bit = B1.bit;
        this.dict[Akey+"01"] = {type:B2.type}
        this.dict[Akey+"00"] = {type:B2.type}
        delete B2.type
    }


     //added 30-04-25

    NB.bit = B1.bit
    NA1.bit = A.bit
    NA2.bit = A.bit
    
    let ax = this.dict[Akey+"10"]
    let ay = this.dict[Akey+"01"]


    this.dict[Akey] = NB
    this.dict[Akey+"1"] = NA1
    this.dict[Akey+"0"] = NA2
    
    // this.dict[Akey+"10"] = ay
    // this.dict[Akey+"01"] = ax
    
    
    this.swapChildren(Akey+"10",Akey+"01")

    // NA1 = 
  }

  static swapChildren(Akey,Bkey){
    let newAdict = {}
    let newBdict = {}
    Object.keys(this.dict).forEach((e)=>{
        if(e.substr(0,Akey.length) === Akey){

            newBdict[Bkey + e.substr(Akey.length )] = this.dict[e]
            delete this.dict[e]
        }
        if(e.substr(0,Bkey.length) === Bkey){
            newAdict[Akey + e.substr(Bkey.length )] = this.dict[e]
            delete this.dict[e]
        }
    })

    Object.keys(newAdict).forEach((e)=>{
        this.dict[e] = newAdict[e]
    })
    Object.keys(newBdict).forEach((e)=>{
        this.dict[e] = newBdict[e]
    })


  }

    
    static simShift(Akey,force=true){
      let A = this.dict[Akey]
      
      if(A==undefined || A.bit==undefined){return}
      
      
      if(this.dict[Akey+"0"]?.type === this.dict[Akey+"1"]?.type && this.dict[Akey+"1"]?.type !== undefined){
        let x = this.dict[Akey+"1"].type
        this.dict[Akey].type = x
        delete this.dict[Akey].bit
        delete this.dict[Akey+"0"]
        delete this.dict[Akey+"1"]
        // console.log("combined")
        return
      }
      
      if(force && this.dict[Akey+"0"]?.bit === this.dict[Akey+"1"]?.bit && this.dict[Akey+"0"]?.bit !== undefined){
        this.hierarchicalShift(Akey)
        // console.log("shifted")
        return
      }
      
      
    }
    static simShiftAll(){
      Object.keys(this.dict).forEach((e)=>{
        this.simShift(e,false)

        let t = false
        Object.values(this.dict).forEach((e)=>{
            t = t||(e===undefined)
        })
        if(t){
            console.log("HEYYY")
        }

      })
    }
        
        
    static condShift(Akey){
      let A = this.dict[Akey]
      if(A.bit===undefined){return}
      
        let askip = (A.skip===undefined?"":A.skip)
        let AkeySkip = Akey + askip
      if(this.dict[AkeySkip+ "0"] === undefined || this.dict[AkeySkip+"1"]===undefined){

        let Bkey = (this.dict[AkeySkip+"0"]===undefined?AkeySkip+"1":AkeySkip+"0")
        // console.log(Akey + " is condable "+Bkey)

        if(this.dict[Bkey]===undefined){

            delete this.dict[AkeySkip]
            // console.log("new cond removal: "+AkeySkip)
            return;
        }

        if(this.dict[Bkey].bit===undefined){
          A.type = this.dict[Bkey].type
          delete A.skip
          delete A.bit
          delete this.dict[Bkey]
          return
        }

        A.bit = this.dict[Bkey].bit
        
        this.dict[Bkey].defunct = true

        if(A.skip === undefined){
          A.skip = ""
        }
        
        let bskip = (this.dict[Bkey].skip===undefined?"":this.dict[Bkey].skip)
        delete(this.dict[Bkey])
        
        A.skip +=  Bkey.substr(-1) + bskip 
        
      }
    }

    static condShiftAll(){
        Object.keys(this.dict).forEach((e)=>{if(this.dict[e]===undefined){return};this.condShift(e)})
    }


    static upShift(Akey){
        let Bkey = Akey.slice(0,-1)

        let sibling = (Bkey+"1"===Akey?Bkey+"0":Bkey+"1")

        if(this.dict[sibling].bit!== undefined || this.dict[Akey].bit === undefined){return}

        if(this.dict[Akey + "1"].bit !== undefined || this.dict[Akey + "0"].bit !== undefined ){return}

        this.dict[Bkey].bit = this.dict[Akey].bit
        this.dict[Bkey + "1"] = this.dict[Akey + "1"]
        this.dict[Bkey + "0"] = this.dict[Akey + "0"]

        delete this.dict[Akey + "1"]
        delete this.dict[Akey + "0"]


    }
    static upShiftAll(){
        Object.keys(this.dict).forEach((e)=>{if(this.dict[e]===undefined){return};this.upShift(e)})
    }


    static learn(){
        for(let i = 0; i < 15; i++){this.condShiftAll()}
        this.regrow()
        for(let i = 0; i < 15; i++){this.simShiftAll()}
    }

    static usefulness(dict,bit){
        let ans = this.classify(dict,2).a

        if(dict[bit]){dict[bit]=0}else{dict[bit] = 1}
        let ans2 = this.classify(dict,2).a

        if(ans === ans2){console.log("not useful")}

    }


    static infuseWith(Akey,infusion){


        if(this.dict[Akey].bit+"" === infusion+""){
          // console.log(Akey)
          return}

        if(this.dict[Akey].bit === undefined){
            this.dict[Akey+"1"] = {type:this.dict[Akey].type}
            this.dict[Akey+"0"] = {type:this.dict[Akey].type}
            this.dict[Akey].bit = infusion
            delete this.dict[Akey].type
            return
        }


        this.infuseWith(Akey+"1",infusion)
        this.infuseWith(Akey+"0",infusion)
    }


    static upLevel(bit){
        bit = bit + ""
        Object.keys(this.dict).forEach((e)=>{

            if(this.dict[e]===undefined){return}

            if(this.dict[e].bit+"" === bit && e!==""){
                // console.log(e.slice(0,-1))
                this.simShift(e.slice(0,-1))
            }
        })
    }

    static terminators(){
        let dict = {}
        Object.keys(this.dict).forEach((e)=>{
            if(this.dict[e].bit===undefined){
                let bt = this.dict[e.slice(0,-1)].bit
                if(dict[bt]==undefined){dict[bt] = 0}
                dict[bt] += 1
            }
        })
        return(dict)
    }



    static allUsedBits(){
      let bitSet = new Set()
        Object.keys(this.dict).forEach((e)=>{
          if(this.dict[e].bit){
            bitSet.add(this.dict[e].bit)
          }
        })
        return(bitSet)
    }



    static terminatorTest(){
      let bitSet = this.allUsedBits()
      let dictArr = []
      Object.keys(this.dict).forEach((e)=>{
        if(this.dict[e].bit === undefined){
          let str = e
          let ansDict = {"ANS":this.dict[e].type}
          while(str.length>0){

            ansDict[this.dict[str.slice(0,-1)].bit] = str.substr(-1)
            str = str.slice(0,-1)
          }
          dictArr.push(ansDict)
        }
      })
      return(dictArr)
    }

    static trainsetFrom(dictArr=this.terminatorTest(),count=5){
      let bitSet = this.allUsedBits()
      let trainArr = []

      for(let i = 0; i < count; i++){
        dictArr.forEach((e)=>{
          // let ans = e.ANS
          // delete e.ANS
          let dictOut = {ANS:e.ANS}
          bitSet.forEach((E)=>{
            if(e[E]===undefined){
              dictOut[E] = Math.random()>0.5?1:0
            } else {dictOut[E] = e[E]}
          })
          trainArr.push(dictOut)
        })
      }
      return(trainArr)
    }


    static testCase(){
      let bitSet = this.allUsedBits()
      let ansDict = {}
      bitSet.forEach((e)=>{
        ansDict[e] = Math.random()>0.5?1:0
      })
      let ans = this.classify(ansDict,2).a
      return({key:ansDict,ans:ans})
    }

    static test(arr){
      let pass = 0;
      let fail = 0;
      for(let i = 0; i < arr.length; i++){
        let cs = arr[i] //case
        let correct = this.classify(cs,2).a==cs.ANS
        pass += correct
        fail += !correct
      }
      console.log("passes: "+pass+" fails: "+fail)
      return(fail===0)
    }



    static randomUpLeveling(){

    }




    
    static regrow(){
      let newDict = {}
      
      let unprocessed = [{s:"",k:""}]
      while(unprocessed.length > 0){
      let newUnprocessed = []
      for(let i = 0; i < unprocessed.length; i++){

        let k = unprocessed[i].s
        if(this.dict[k]==undefined){continue}
        let skip = (this.dict[k].skip===undefined?"":this.dict[k].skip)
        
        let p1 = {s:k + skip + "0",k:unprocessed[i].k+"0"}
        let p2 = {s:k + skip + "1",k:unprocessed[i].k+"1"}
        
        newDict[unprocessed[i].k] = this.dict[k]

        newUnprocessed.push(p1)
        newUnprocessed.push(p2)
        
        
      }
        unprocessed = newUnprocessed
    }

      Object.keys(newDict).forEach((e)=>{
        delete newDict[e].skip
        if(newDict[e].bit!==undefined){
          newDict[e].bit += ""
        }
      })
      
      this.dict = newDict
      return(newDict)
      
    }

    static scoreMem(){//server side method!
      let scores = {}
      this.memory.forEach((e)=>{
        let c = this.classify(e.d,2)
        if(scores[c.s]===undefined){
          scores[c.s] = {"wrongs":0,"corrects":0}
        }

        if(c.a!==e.a){scores[c.s].wrongs+=1;return}
        scores[c.s].corrects += 1
      })
      return(scores)
    }

    static removeUseless(loose=Infinity){
      let s = this.scoreMem()
      Object.keys(this.dict).forEach((e)=>{
        if(this.dict[e].bit!==undefined){return;}
        let score = s[e]
        if( score === undefined || score.corrects == 0 && score.wrongs > 0 || score.wrongs/score.corrects > loose){
          // console.log("removing: "+e)
          delete this.dict[e]
        }
      })
      console.log("remaining: "+Object.keys(ALG.dict).length)
    }

    static bitsUsed(str){
      let bu = new Set()
      while(str.length > 0){
        if(this.dict[str].bit!==undefined){
          bu.add(this.dict[str].bit)
        }
        str = str.slice(0,-1)
      }
      return(bu)
    }


}

function atd(arr){
  let dict = {}
  arr.forEach((e,i)=>{
    dict[i] = e
  })
  return(dict)
}
                                     
function sd(str){
  let arr = str.split("")
  arr.forEach((e,i)=>{
    arr[i] = parseInt(e)
  })
  return(atd(arr))
}

  console.log(str)
  arr = JSON.parse(str)
  return(arr)
}

            // .subject(d => ({x: x(d[0]), y: y(d[1])}))
            .on("start", dragstarted)
            .on("drag", dragged)
            .on("end", dragended));

        function ticked() {
            link.attr("x1", d => d.source.x)
                .attr("y1", d => d.source.y)
                .attr("x2", d => d.target.x)
                .attr("y2", d => d.target.y);
            node.attr("cx", d => d.x)
                .attr("cy", d => d.y);
            node.attr("x", d => d.x)
                .attr("y", d => d.y);
        }

        function dragstarted(event) {
            if (!event.active) simulation.alphaTarget(0.9).restart();
            event.subject.fx = event.subject.x;
            event.subject.fy = event.subject.y;
        }


  function distance(x1,y1,x2,y2) {
  let a = x2-x1
  let b = y2-y1
  return(Math.sqrt(a*a+b*b))
}

        function dragged(event) {
          fm = distance(event.subject.x,event.subject.y,event.x,event.y)/100
            event.subject.fx = event.subject.x+(event.x-event.subject.x)*fm;
            event.subject.fy = event.subject.y+(event.y-event.subject.y)*fm;
            // event.subject.fx = event.sourceEvent.pageX
            // event.subject.fy= event.sourceEvent.pageY

        }

        function dragended(event) {
            if (!event.active) simulation.alphaTarget(0);
            event.subject.fx = null;
            event.subject.fy = null;
        }

        // Append the SVG to the div.
        document.getElementById('chart').appendChild(svg.node());



            function addNodeAndLink(newNodeId, newNodeGroup, existingNodeId) {
        // Create a new node object
        const newNode = { id: newNodeId, group: newNodeGroup };
        nodes.push(newNode); // Add new node to nodes array

        // Create a new link object (linking to the existing node)
        const newLink = { source: existingNodeId, target: newNodeId, value: 1 };
        links.push(newLink); // Add new link to links array

        // Restart the simulation with the updated nodes and links
        simulation.nodes(nodes);
        simulation.force("link").links(links);
        simulation.alpha(1).restart(); // Restart the simulation

        // Update the SVG elements
        updateSVG();
    }

    function RE(){
      if(!ANIMATE){return}
        simulation.nodes(nodes);
        simulation.force("link").links(links);
        simulation.alpha(1).restart(); // Restart the simulation

        // Update the SVG elements
        updateSVG();
    }

    function updateSVG() {
        // Update links
        link = svg.selectAll("line")
            .data(links)
            .join("line")
            .attr("stroke-width", d => Math.sqrt(d.value))
            .attr("stroke", "#999")
            .attr("stroke-opacity", 0.6);

        // Update nodes
        node = svg.selectAll("circle")
            .data(nodes)
            .join("circle")
            .attr("r", 5)
            .attr("fill", d => color(d.group))
            .call(d3.drag()
                .on("start", dragstarted)
                .on("drag", dragged)
                .on("end", dragended));

        node.append("title").text(d => d.id+" INFO HERE MAY BE ADDED");

        dog = svg.selectAll("text")
            .data(nodes)
            .join("text")
            .text(d => ALG.dict[d.id].bit).attr("stroke","#000")
            .style("pointer-events","none");


        node = svg.selectAll("circle, text")

    }
